geregisseerd door Zack Snyder
met Henry Cavill, Michael Shannon en Amy Adams

Voordat de stervende planeet Krypton ontploft stuurt wetenschapper Jor-El zijn enige zoon, de pasgeboren Kal-El, naar planeet Aarde. Het ruimteschip van de baby crasht in het weiland van Jonathan en Martha Kent. Zij voeden Kal-El op en geven hem een nieuwe naam: Clark Kent. Clark groeit op als normale jongen, maar weet dat hij anders is dan andere kinderen. Niet iedereen kan immers een schoolbus optillen. Op latere leeftijd worstelt hij nog steeds met zijn identiteit, al gaat de zoektocht naar zijn ware ik een stuk gemakkelijker wanneer General Zod, een overlevende generaal van Krypton, de aarde aanvalt met een klein leger. Sluit Clark zich bij zijn soortgenoten aan, of zet hij zich in voor zijn nieuwe thuisplaneet?



